import React from 'react';

import { overlay } from './overlay';
import Alert from './alert';


export const Modal = {

  unmountLogin: (() => null),

  show: () => {
    this.unmountLogin = overlay.create(<Alert type="success">YEET</Alert>, {});
  },

  hide: () => {
    this.unmountLogin();
  }
}
